INSERT INTO `errores` (`id`, `problem`, `printer`, `probable_cause`, `corrective_action`, `video`) VALUES
	(1, 'LEDs do not light.', 5, '1) Insufficient supply voltage. \n2) Machine is not plugged in.', '1) Look at the line voltage level shown on the back of the printer (see Figure 5). Confirm \nthat the mains line voltage for your location is within the range limits.\n2) Check that both ends of the power cord are plugged in securely.\n3) Confirm that the outlet the machine is plugged into has power.', NULL),
	(2, 'Sonics are not working and  power supply light is off.', 8, '1 – Blown fuse   2 – On / Off switch in “off” \nposition  3 – Power lamp bulb burned out  4 - Interface cable not plugged in', '1 – Replace fuse on back end of power \nsupply.  2 – Move switch to “on” position   3 – The lamp could be off but power supply \ncooling fan is running.  Unit is OK to \noperate.  4 – Check interface cable between power \nsupply and SS Finisher', NULL),
	(3, 'Sonic power supply is on but  no vibration is felt at the  converter in test mode.', 8, '1 - Cable to converter is bad.  2 - Converter is bad.    3 - Horn is bad  4 - Power supply is bad.   5 - Horn assembly not connected \nto power supply ', '1 – Replace the stack assembly.  2 – Replace the stack assembly  3 – Replace the stack assembly  4 – Replace power supply –  \n  Return for rebuilding   5 – Check connection', NULL),
	(4, 'Fabric cut is indented - but  not severed in two.', 8, '1 - Improper power setting  2 - Power supply not turned on  3 - Knife has become dull  ', '1 – Turn on power supply – check all \nconnections  2 – Turn on power supply   3 – Change knife blade insert.', NULL),
	(5, 'Fabric cuts on only one side.', 8, '1 - Knife anvil is not parallel with \nthe horn. ', '1 – See knife-leveling procedure in the blade \nreplacement section. ', NULL),
	(6, 'Machine fails to power up', 8, '1 – Incorrect power amplitude   2 – Lack of power to the machine  3 – Missing or blown fuse(s)  4 – Unconnected cable / connector \ninside machine.', '1 - Confirm that the AC entry is configured for the \nline voltage intended to be applied to the \nmachine.  Failure to do so can damage the \nmachine’s internal power supply.  Refer to the \n“Fuse Configuration”  2 - Check that both ends of the power cord are \nsecurely plugged in.  2A - Confirm that the outlet the machine is plugged \ninto has power. 3 - Check that the fuse(s) located inside the AC \nentry are present and intact.  Replace as needed.  \nRefer to the Fuse Configuration.  4 - Power off and remove the power cord from the \nAC entry.  Remove the back cover and inspect \nthe cables and connectors to and from the power \nsupply.  Refer to the “Electrical System \nSchematic”.', NULL),
	(7, 'Front panel displays no  text or nothing at all', 8, '1 – Front panel cable unplugged.', '1 - Power off and remove the power cord from the \nAC entry.  Remove the back cover and inspect \nthe cables and connectors to and from the front \npanel.  Refer to the “Electrical System \nSchematic”. ', NULL),
	(8, 'Front panel does not  complete diagnostic test 1. ', 8, ' 1– Front panel board unplugged \nfrom the main board. ', '1 - Power off and remove the power cord from the \nAC entry.  Remove the back cover and check \nconnectors. ', NULL),
	(9, 'Stock does not advance  when the start button is  pressed.', 8, '1 – An interlock condition exists.   2 – Tag length or Offset values are \ninvalid.  3 – Feed motor unplugged or faulty.  4 – Feed roller not gripping stock. 5 – Feed rollers bound. 6 – Stock Bound ', '1 - Determine the number and type of interlock(s) \nby reading the front panel display.  As each is \ncorrected, the number of errors will decrease.  2 - Check values located in front panel and adjust.  3 - Check feed motor cable and/or replace feed \nmotor.  4 - Adjust feed pressure.  Refer to “Mechanical \nAdjustment of Feed Roller Pressure”.  5 - With power off, check that all rollers turn freely.  6 - Check that stock will pull through the printer \nwith little or no resistance.', NULL),
	(10, 'The Stacker fails to run. ', 8, '1- The stacker cable is not connected. 2 – Faulty Stacker Motor.  3 – Stacker jammed.   ', '1 - Power off and remove the power cord from the \nAC entry.  Remove the back cover and inspect \nthe cables and connectors.  2 - Replace Stacker Motor.  3 - Remove cause of the jam at the stacker. ', NULL),
	(11, 'DIAGNOSTIC  TEST  1', 8, 'When the SS Finisher detects an error condition, the display will show the last \nerror encountered.  When the last error is removed – the display will show \nprevious errors – if they exist. When the machine is first powered on, the front panel will display the following screen; ', 'If the front panel display remains in this condition – it is indicating a failure to \ncommunicate from the front panel to the motherboard.  Check connections to the \nmotherboard.', NULL),
	(12, 'ALIGN  STOCK ', 8, 'If the length of the label is not set correctly or there is a problem with the feed \nmechanism – the machine will not operate and the following error message will \nbe displayed', 'Check the length or set the label correctly', NULL),
	(13, 'CLOSE  GUARD', 8, 'If the guard door is open or if there is a faulty interlock switch – the machine will \nnot operate and the following message will be displayed;', 'Close the guard door', NULL),
	(14, 'Machine fails to power up', 10, 'Lack of power to machine ', 'Check that both ends of power cord on printer aresecurely plugged in.  Confirm that the outlet the printer is plugged into \nhas power.  Confirm all Sonic Knife cables are securely plugged in.', NULL),
	(15, 'Stock does not advance  through Sonic Knife when  printer start button is   pressed', 10, 'Jam in Feed Rollers', 'Check Feed Rollers for obstruction or jam.  If necessary - Re-thread fabric through feed rollers.  Check to see Feed Rollers are clean.', NULL),
	(16, 'Cut on one side of fabric only', 10, 'Out of level Knife Blade.  Fabric not centered on horn.', 'Follow Knife Blade leveling procedure on page 20.  Check all label guides and mounting brackets to make sure fabric is centered on horn. ', NULL),
	(17, 'Not cut on fabric', 10, 'Out of level Knife Blade.  Ground Detect “on” too soon .  Sonic power supply off.  Spring pressure too light.  Spring pressure too heavy.  Knife dwell setting incorrect.  Sonic Power Supply not triggering (the bar indicator on the top front \nof the Power Supply should flash for every cut. If it does not, the Power Supply is not being triggered)', 'Follow Knife Blade leveling procedure on page 20 . Check to make sure home sensor triggers at TDC.  Make sure Sonic power supply is turned “on”.  Check Spring Pressure setting procedure on page 21.  Check Spring Pressure setting procedure on page 21.  Check Knife Dwell setting procedure on page 21.  Check the Proximity Switch adjustment on page 23.', ''),
	(18, 'LEDs flash ', 5, '1) PC board power failure', '1) Cycle the power off and back on again.', ''),
	(19, 'Printer says “Boot Error  1” or “Hardware error  1. Printer requires  service” or “PCI  interface bad. Change  the MCB” during  power up ', 5, '1) PCB failure.  2) Motherboard failure', '1) Replace MCB board.  2) Replace motherboard ', ''),
	(20, 'Printer says “Boot Error  2” or “Hardware error  2. Printer requires  service” or “BIOS  Corrupted. Replace  the motherboard or  reset the BIOS” during  power up ', 5, '1) Corrupted BIOS.  2) Motherboard failure.', '1) Connect a standard PC monitor and keyboard to the printer and follow the instructions found in the Engineering Bulletin “06_015_500_BIOS_Revised.doc” to reset the BIOS settings.\r\n2) Replace motherboard', ''),
	(21, 'Printer says “Boot Error  3” or “Hardware error 3. Printer requires  service” or “Corrupted  safe operating system.  Replace the flash disk”  during power up.  (Message depends on  software version.)', 5, '1) Flash Disk Failure .  2) Motherboard Failure', '1) Replace Flash Disk Module.  2) Replace motherboard', ''),
	(22, 'Printer says “Boot Error  4” or “Hardware error  4. Printer requires  service” or “Cannot  communicate with the  MCB. Change the  MCB” during power  up. (Message depends  on software version.)', 5, '1) PCB failure.  2) Motherboard Failure', '1) Replace MCB Board.  2) Replace motherboard ', ''),
	(23, 'Printer says “Running  Backup Operating  System.  Please  upgrade” after power  up. (Message depends  on software version.) ', 5, '1) Upgrade failure.  2) Software failure', '1) Upgrade to the latest operating system.   2) Upgrade to the latest operating system.  \r\nNOTE: The safe operating system will run the printer, but it does not have the latest features and improvements.  Upgrade as \r\nsoon as possible. ', ''),
	(24, 'Machine does not  receive data. ', 5, '1) Communications cable is loose or unconnected. 2) Incompatible communication cable. 3) Machine is not powered on or \r\nhas not completed diagnostics tests.  4) Data sent to wrong printer. 5) Configuration incorrect in PCMate. 6) Faulty Mother Board ', '1) Check and secure both ends of the serial cable with the thumbscrews.  2) Ensure the communication cable is a null \r\nmodem serial cable with DB9F connector.  3) Power machine on and wait until machine ready light is on.  Re-download data.  4) In PCMate change to the printer where the data is intended to be sent. 5) Reconfigure PCMate for AVERY DENNISON PCL printer as per your PCMate manual.  6) Replace the Mother Board.', ''),
	(25, 'Tape or ink does not  advance when the  start button is  depressed.', 5, '1) No batches to be printed (Data light is not on.).    2) An interlock condition exists(Supply or Error light is on.)  3) Tape is bound.  4) Ink is bound.', '1) Download batch (If batch downloaded uses the same design as a previously downloaded batch, the machine will start \r\nautomatically).  2) Press the voice button to determine the error. 2.1) If using PCMate Platinum, check the virtual \r\ncontrol / display. 2.2) If using the Remote Control / Display Module, view error message.  3) Remove and rethread the tape.  4) Remove and rethread the ink.', ''),
	(26, 'Tape tracks inward or  outward while printing', 5, '1) Stock Arbor Tension too low.  2) Feed Assembly Alignment Incorrect.   3) Feed Assembly Damage.', ' See Section 6.5 ', ''),
	(27, 'Tape advances but the  printer does not print.', 5, '1) Tape registration sensor is misaligned (preprinted tapes only).  2) Print head cable is disconnected or faulty.  3) Print head is faulty.  4) Tape and Ink Transfer Type selection in Design File doesn’t match supplies.', '1) Re-align sense mark with sensor, refer to section 3.3.6.2 Sensors.  2) Power off the machine and reinsert the print head connector or replace the cable.  3) Replace the print head.   4) Refer to the PCMate software manual. ', ''),
	(28, 'Machine stops after  every third label.', 5, '1) Tape registration sensor is misaligned (preprinted tapes only).  2) Label length selection in the Design File doesn’t match the printed tape length. ', ' Refer to the PCMate software manual.', ''),
	(29, 'Print registration is off in  the feed direction.', 5, '1) Print position is incorrect.  2) Field(s) position incorrect in the Design File.  3) Sense–to–cut selection in the Design File is incorrect.  4) Bound print roller.', '1) Use the Virtual Control / Display or Remote Control / Display to adjust the print position.  2) Refer to PCMate software manual.   \r\n3) Refer to PCMate software manual.  4) Check that the print roller turns freely on its shaft.  If it does not, replace it.', ''),
	(30, 'Print registration is off in  the web direction.', 5, '1) Machine is incorrectly threaded.  2) Web guides incorrectly adjusted.  3) Tape Arbor is not tight.', '1) Check and rethread the media as needed. Refer to section 3.1.3 Loading the Tape. 2) Check and adjust web guides as needed.  \r\nRefer to section 6.2, Tape (Web) Guide Width Adjustments.  3) Check and adjust as needed.  Refer to section 3.1 Loading Supplies. ', ''),
	(31, 'Print density is too light  or too dark.', 5, '1) Tape and Ink Transfer Type selection in Design File doesn’t match supplies.  2) Incorrect contrast setting in the machine setup.  3) Misadjusted print head pressure. ', '1) Refer to the PCMate Platinum software manual. 2) Adjust the contrast control on each print head.  Refer to section 4.1 Print Head \r\nAdjustments. 3) Set print head pressure.  Refer to section \r\n4.1 Print Head Adjustments.', ''),
	(32, 'Voids in print image in  the feed direction. ', 5, '1) Ink is misaligned with the tape.  2) Print head is dirty.  3) Faulty print head. 4) Misadjusted print head pressure.  5) Worn printer roller. ', '1) Ink must be 1/4” or 5 mm wider than the tape.  Example: 1”(25 mm) web requires  1 ¼” (30 mm) ink.  2) Power off the machine.  Clean the print head and print.  Refer to section 5.1, Print Head Cleaning and Handling.  3) After cleaning the print head and running a test label, if a void still exists, replace the print head.  4) Set print head pressure.  Refer to section 4.1.1, Adjusting Print Head Pressure.  5) Contact your local AVERY DENNISON representative.', ''),
	(33, 'Machine fails to cut  labels (the rotary  knife does not rotate).', 5, '1) The knife is disabled.  2) Cut count is set to “0” in the Design File. ', '1) Enable the knife in the setup menu via the Remote Control / Display Module section 7.0, or through the Virtual Control / Display in PCMate Platinum section 8.0.   2) Refer to the PCMate software manual. ', ''),
	(34, 'The stacker platform  fails to run. ', 5, '1) The stacker cable is disconnected. ', '1) Power off the machine and insert the stacker cable in the stacker port.', ''),
	(35, 'Labels will not stack.', 5, '1) Stacker is not operating.  2) Stacker position on the machine too high or too low.  3) Incorrect position platform bed angle. 4) Static brush height too high or too low ', '1) Be sure the nip roller is free to rotate.  2) Move the toggle switch to the opposite position.   3) Use the pull pin to change the platform angle. 4) Adjust height of static brush on exit nip rollers.', ''),
	(36, 'Knife does not cut  completely through. ', 5, '1) Knife blade shear is misaligned.', '1) Refer to section 6.4, Knife Shear Adjustment. ', ''),
	(37, 'Knife will not cut. ', 5, '1) Knife blades are dull.  ', '1) Refer to section 5.4.1, Removing and Replacing the Knife assembly. ', ''),
	(38, 'KNIFE DID NOT HOME', 5, 'Knife Error.  Press start to continue.', 'The knife did not complete the cut properly, or the \r\nknife could not initialize properly.  Try again.  If this \r\nhappens frequently or continuously, the knife needs \r\nservice', ''),
	(39, 'STACKER FULL ', 5, 'The stacker is full.  \r\nRemove labels from \r\nthe stacker.', 'The stacker is full.  Remove all labels from the \r\nstacker.  If this error occurs when there are no labels \r\non the stacker, the stacker requires service. ', ''),
	(40, 'STACKER SENSOR ERROR', 5, 'Stacker sensor error.  \r\nRemove labels from \r\nthe stacker.', 'This error occurs when the stacker tries to position \r\nthe platform before printing.  The platform position \r\nsensor did not respond as expected.  This is usually \r\ncaused by labels blocking the sensor.  Remove all \r\nlabels from the platform and try again.  If the error \r\nstill occurs, the stacker requires service. ', ''),
	(41, 'BOTTOM CLOSED ', 5, 'Open the bottom \r\nprint station for a \r\nsingle sided format', 'The bottom print station roller must be open to print a \r\nsingle-sided format.  This eliminates the need to \r\ninstall ink on the unused station.  If this error occurs \r\nwhen the bottom station roller is open, the head open \r\nsensor is not working.', ''),
	(42, 'ST1 (2) LOW TEMP READ  ERR', 5, 'Lower (Upper) print \r\nstation error.  Printer \r\nrequires service.', 'This error indicates that the upper or lower printhead \r\ntemperature is out of normal range.  This is generally \r\ncaused by a disconnected printhead.  Check the \r\nprinthead connections.  If the error still occurs, \r\nchange the printhead.  If the error still occurs, replace \r\nthe printhead cable.  If the error still occurs, replace \r\nthe MCB. ', ''),
	(43, 'MCB CMD_FRE INDEX ERR', 5, 'Internal error.  Press \r\nstart to continue', 'These are internal software errors.  If one of them \r\noccurs, clear the error and continue.  If the error \r\ncontinues to occur, report the error and the \r\ncircumstances that cause it to AVERY DENNISON \r\nService.  These errors are caused by errors in the \r\nsoftware and are not caused by hardware failures. ', ''),
	(44, 'MCB CMD_FSE INDEX ERR', 5, 'Internal error.  Press \r\nstart to continue.', 'These are internal software errors.  If one of them \r\noccurs, clear the error and continue.  If the error \r\ncontinues to occur, report the error and the \r\ncircumstances that cause it to AVERY DENNISON \r\nService.  These errors are caused by errors in the \r\nsoftware and are not caused by hardware failures.', ''),
	(45, 'MCB BAD STACK ERROR', 5, 'Internal error.  Press \r\nstart to continue.', 'These are internal software errors.  If one of them \r\noccurs, clear the error and continue.  If the error \r\ncontinues to occur, report the error and the \r\ncircumstances that cause it to AVERY DENNISON \r\nService.  These errors are caused by errors in the \r\nsoftware and are not caused by hardware failures.', ''),
	(46, 'MCB KNF FLIT TBL TOO  BIG', 5, 'Internal error.  Press \r\nstart to continue. ', 'These are internal software errors.  If one of them \r\noccurs, clear the error and continue.  If the error \r\ncontinues to occur, report the error and the \r\ncircumstances that cause it to AVERY DENNISON \r\nService.  These errors are caused by errors in the \r\nsoftware and are not caused by hardware failures.', ''),
	(47, 'MCB KNIFE STATE TOO  BIG', 5, 'Internal error.  Press \r\nstart to continue. ', 'These are internal software errors.  If one of them \r\noccurs, clear the error and continue.  If the error \r\ncontinues to occur, report the error and the \r\ncircumstances that cause it to AVERY DENNISON \r\nService.  These errors are caused by errors in the \r\nsoftware and are not caused by hardware failures. ', ''),
	(48, 'MCB BEMF MON ST TOO  BIG', 5, 'Internal error.  Press \r\nstart to continue.', 'These are internal software errors.  If one of them \r\noccurs, clear the error and continue.  If the error \r\ncontinues to occur, report the error and the \r\ncircumstances that cause it to AVERY DENNISON \r\nService.  These errors are caused by errors in the \r\nsoftware and are not caused by hardware failures.', ''),
	(49, 'MCB STACKR HM ST TOO  BIG', 5, 'Internal error.  Press \r\nstart to continue. ', 'These are internal software errors.  If one of them \r\noccurs, clear the error and continue.  If the error \r\ncontinues to occur, report the error and the \r\ncircumstances that cause it to AVERY DENNISON \r\nService.  These errors are caused by errors in the \r\nsoftware and are not caused by hardware failures.', ''),
	(50, 'MCB KNF HOME ST TOO  BIG', 5, 'Internal error.  Press \r\nstart to continue. ', 'These are internal software errors.  If one of them \r\noccurs, clear the error and continue.  If the error \r\ncontinues to occur, report the error and the \r\ncircumstances that cause it to AVERY DENNISON \r\nService.  These errors are caused by errors in the \r\nsoftware and are not caused by hardware failures.', ''),
	(51, 'MCB BEMF CTRL ST TOO  BIG', 5, 'Internal error.  Press \r\nstart to continue. ', 'These are internal software errors.  If one of them \r\noccurs, clear the error and continue.  If the error \r\ncontinues to occur, report the error and the \r\ncircumstances that cause it to AVERY DENNISON \r\nService.  These errors are caused by errors in the \r\nsoftware and are not caused by hardware failures.', ''),
	(52, 'MCB SHE BATCH Q  OVERFLOW', 5, 'Internal error.  Press \r\nstart to continue. ', 'These are internal software errors.  If one of them \r\noccurs, clear the error and continue.  If the error \r\ncontinues to occur, report the error and the \r\ncircumstances that cause it to AVERY DENNISON \r\nService.  These errors are caused by errors in the \r\nsoftware and are not caused by hardware failures.', ''),
	(53, 'MCB FVE INDEX ERROR', 5, 'Internal error.  Press \r\nstart to continue.', 'These are internal software errors.  If one of them \r\noccurs, clear the error and continue.  If the error \r\ncontinues to occur, report the error and the \r\ncircumstances that cause it to AVERY DENNISON \r\nService.  These errors are caused by errors in the \r\nsoftware and are not caused by hardware failures.', ''),
	(54, 'MCB ERROR #58, #59, #60, #64, #68, #69, #70, #91, #95, #97, #98, #99', 5, 'Internal error.  Press \r\nstart to continue.', 'These are internal software errors.  If one of them \r\noccurs, clear the error and continue.  If the error \r\ncontinues to occur, report the error and the \r\ncircumstances that cause it to AVERY DENNISON \r\nService.  These errors are caused by errors in the \r\nsoftware and are not caused by hardware failures. ', ''),
	(55, 'OUT OF MEMORY  IMAGER ERROR 919', 5, 'Internal error.  Press start to continue.', 'These are internal errors similar to the ones above.  \r\nHowever, these errors will require power cycling the \r\nprinter.  If the error continues to occur, report the \r\nerror and the circumstances that cause it to AVERY \r\nDENNISON Service.', ''),
	(56, 'LBL TOO SHORT FOR  SPEED', 5, 'Knife cycle error.  \r\nIncrease label length \r\nor select a slower \r\nprint speed.', 'This error indicates that the label is shorter than the \r\nminimum length for the selected print speed.  Refer \r\nto the Printer Specifications for minimum label \r\nlengths.  (Minimum label lengths are different for the \r\nSonic Knife.  Refer to the Sonic Knife manual.)  To \r\nrun and cut the label, you must either make the label \r\nlonger or reduce the print speed. ', ''),
	(57, 'STOCK OUT', 5, 'The tape supply roll \r\nis empty', 'This error indicates the tape supply roll is empty.  If \r\nthe tape supply roll is not empty, make sure the \r\nsupply core is firmly held by the arbor clamp. \r\nIf this error continues to occur, remove the tape roll \r\nand press the Start button (the Ready light must be \r\non).  The tape arbor should spin counter-clockwise \r\nbriefly.  If it doesn’t, the motor or MCB is defective.  If \r\nit spins and you continue to get the error after re-\r\ninstalling the tape roll, the MCB is defective. ', ''),
	(58, 'INK OUT BOTTOM (TOP) ', 5, 'The lower (upper) \r\nprint station ink roll is \r\nempty', 'This error indicates that the ink on the specified print \r\nstation is either missing or broken, or the supply roll \r\nis empty. \r\nIf this error continues to occur even though the ink \r\nsupply rolls are properly installed, remove the ink \r\nrolls and press the Start button.  The unwind (supply) \r\narbor should spin counter-clockwise and the rewind \r\n(take-up) arbor should spin clockwise briefly.  If one \r\nor both of the motors does not spin, the motor(s) or \r\nMCB are defective.  If both motors spin, install a new \r\nink roll.  If the error continues to occur with the new \r\nink roll, the MCB is defective. \r\nIf this error occurs while printing pressure sensitive \r\nadhesive labels on a SNAP 500 GEN2, the labels are \r\ncausing too much drag through the printer. Reduce \r\nprinthead pressure and use a red platen roller. ', ''),
	(59, 'HEAD OPEN BOTTOM  (TOP)', 5, 'The lower (upper) \r\nprint station roller is \r\nopen ', 'This error indicates that either the upper or lower \r\nplaten roller is open.  Close the roller.  If the error \r\ncontinues to occur when the roller is closed, check \r\nthe roller open sensor. ', ''),
	(60, 'MISSED SENSE MARK ', 5, 'Missed sense mark', 'The format specifies a sense mark, but no sense \r\nmark was found.  Possible causes are misalignment \r\nof the sensor to the sense mark or incompatibility of \r\nthe sense mark and the sensor type.  Another \r\npossible cause is a mismatch between the label \r\nlength that is set in the format with the actual \r\ndistance between sense marks on the stock.', ''),
	(61, 'HEAD 1 (2) OVER TEMP  ', 5, 'The lower (upper) \r\nprint head is \r\noverheated.  Wait \r\nuntil the error light to \r\ngo out then press \r\nstart to continue ', 'The printer continuously monitors the temperature of \r\nthe printhead to ensure it doesn’t overheat and \r\ndamage the printhead.  When the printhead \r\ntemperature reaches a pre-set limit, the printer will \r\nstop with this error.  Wait for the error light to go out \r\nand continue printing.  However, it is likely that the \r\nerror will happen again.  Possible solutions are to \r\nreduce the print speed or to reduce the amount of \r\ncopy on the label. \r\nIf this error happens when the printer is first turned \r\non or does not clear itself within a few minutes, the \r\nprinthead or MCB may be defective.', ''),
	(62, 'VERIFIER HALT 1 OR 2  912', 5, 'Bar code failure', 'This indicates that the bar code verifier found a bad \r\nbar code.  The most likely cause is a print quality \r\nproblem such as an ink wrinkle or a dot out on the \r\nprinthead.  If this error happens on every label, check \r\nthe printhead for dots out.  If this error happens often, \r\nbut not every label, check the bar code minimum \r\nheight requirement or lower the ANSI grade.', ''),
	(63, 'BUFFER OVERFLOW', 5, 'Communication error.  \r\nPress start to \r\ncontinue.', 'This error indicates that the host computer sent more \r\ndata than the printer can handle.  This error is \r\ngenerally caused by a mismatch in the serial protocol \r\nsetting (XON/XOFF or RTS/CTS) between the printer \r\nand the host, or a cable that does not have the \r\nRTS/CTS lines.', ''),
	(64, 'TOO MANY FIELDS', 5, 'N/A', 'The number of fields on the label exceeds the \r\nmaximum number allowed.', ''),
	(65, 'SOFTWARE MISMATCH', 5, 'The imager and MCB \r\nsoftware versions are \r\nnot compatible ', 'The printer checks to make sure the software \r\nversions within the printer are compatible.  This error \r\nindicates that the versions are not compatible.  \r\nUpgrade to the latest operating system software. ', ''),
	(66, 'MCB ERROR #61, #62, #63, #65, #66, #67, #71, #72, #73, #74, #78, #79, #80, #84, #85, #86, #87, #88, #89, #91, #92, #93, #94, #100', 5, 'Internal error.  Press \r\nstart to continue.', 'These errors are all related to identification devices \r\nin the printer or peripherals that are used to read the \r\nprinter configuration.  If one of these errors continues \r\nto occur after a power cycle, disconnect all \r\nperipherals (stacker, sonic knife, etc.).  If the problem \r\nstill occurs, replace the Frame ID memory.  If it still \r\noccurs, replace the MCB. \r\nIf disconnecting the peripherals fixes the problem, re-\r\nconnect one at a time to determine which one is \r\ncausing the problem, then replace the printer \r\ninterface harness.', ''),
	(67, 'MCB ID NOT FOUND', 5, 'Internal error.  Press \r\nstart to continue.', 'These errors are all related to identification devices \r\nin the printer or peripherals that are used to read the \r\nprinter configuration.  If one of these errors continues \r\nto occur after a power cycle, disconnect all \r\nperipherals (stacker, sonic knife, etc.).  If the problem \r\nstill occurs, replace the Frame ID memory.  If it still \r\noccurs, replace the MCB. \r\nIf disconnecting the peripherals fixes the problem, re-\r\nconnect one at a time to determine which one is \r\ncausing the problem, then replace the printer \r\ninterface harness. ', ''),
	(68, 'FRAME ID NOT FOUND ', 5, 'Internal error.  Press \r\nstart to continue. ', 'These errors are all related to identification devices \r\nin the printer or peripherals that are used to read the \r\nprinter configuration.  If one of these errors continues \r\nto occur after a power cycle, disconnect all \r\nperipherals (stacker, sonic knife, etc.).  If the problem \r\nstill occurs, replace the Frame ID memory.  If it still \r\noccurs, replace the MCB. \r\nIf disconnecting the peripherals fixes the problem, re-\r\nconnect one at a time to determine which one is \r\ncausing the problem, then replace the printer \r\ninterface harness. ', ''),
	(69, 'MCB ERROR #96 ', 5, 'Internal error.  Press \r\nstart to continue.', 'This error is related to the Security Batch Count \r\nfeature.  It indicates that the Batch Count queue is \r\nfull, which should never happen.  The only way to \r\nrecover from this is to reset the MCB by removing the \r\nbattery on the MCB with the power off, then replacing \r\nit.  This will also reset all the printer settings (print \r\nand cut adjust, baud rate, cutter enable, etc.) to their \r\ndefault values. ', ''),
	(70, 'Tape will not roll  smoothly or the tape  jumps.', 5, '1) Web guides are incorrectly adjusted.', '1) Be sure stock roll is as flat as possible and do not extend over core. \r\n2) Adjust web guides to touch stock roll, but do not pinch the roll. ', ''),
	(71, 'Tape does not pull  smoothly through print  head module.', 5, '1) Web guides are too tight.', '1) Adjust web guides to touch outer edges of tape with the minimum pressure required.', ''),
	(72, 'Tape jams in bridge  blade rollers or knife  area.', 5, '1) Knife not cutting the full width of stock.  2) Nip rollers are not turning.', '1) Refer to section 6.4, Knife Shear Adjustment.  2) Be sure the nip roller is free to rotate and moves easily in the bearing slots.  Check for a loose drive gear.', ''),
	(73, 'Ink wrinkles or will not  pull smoothly.', 5, '1) Ink supply and rewind rolls are misaligned.  2) Ink buildup on the turn bar(s).  3) Incorrect ink width. ', '1) Make sure rewind core is equal to or wider than the supply roll width.  1.1) Check that the motor is working and has back tension on the supply roll.  2) Clean the turn bar(s) with alcohol.  3) Use an ink width ¼” (5 mm) wider than the tape being printed on. ', ''),
	(74, 'Ink rolls loosely on  Rewind core.', 5, '1) Ink rewind roll not turning.  2) Ink rewind roll is too full.', '1) Check that the motor is working.   2) Remove ink rewind roll.  Replace ink rewind roll with an empty core. ', ''),
	(75, 'Poor print – uneven or  no print.', 5, '1) Print head pressure is too light.   2) Ink rewind roll is too full. ', '1) Move pressure buttons to opposite position.   1.1) Ensure that both pressure buttons are set to the same position.  2) Remove ink rewind rolls and replace with empty cores. ', ''),
	(76, 'Knife stops during cut in  stock.', 5, '1) Knife blades are dull. ', '1) Refer to section 5.4.1, Removing and Replacing the Knife Assembly.', ''),
	(77, 'Tape is popping in front  of the knife. ', 5, '1) Knife blades are dull. ', '1) Refer to section 5.4.1, Removing and Replacing the Knife Assembly. ', ''),
	(78, 'Machine drops short  tickets between  knife and nip roller  assembly. See  section 10.3 for  minimum length  ticket requirements.', 5, '1) Knife out of alignment', '1. Loosen knife bracket screws shown in diagram.  1.1. Rotate knife towards nip roller assembly.  1.2. Hold in place while tightening \r\nscrews.', ''),
	(79, 'Stacker fails to move up  or down when start  button is depressed.', 5, '1) Interface cable ', '1) Not plugged in all the way.  1.1) Just installed and needs to be power cycled for printer to identify option installed. \r\n1.2) Printer has no batches to print. ', ''),
	(80, 'Platform cannot find  home ', 5, '1) Sensor unplugged.  2) Sensor out of alignment', '1) Remove back cover and check connections.  1.1) Broken wire or damaged LED.  2) Outer bracket bent and needs to be \r\nreformed.', ''),
	(81, 'Top of stack is blocking  incoming labels', 5, '1) Sensor not operational', '1) Check sensor alignment.  1.1) Stacker not connected.  1.2) Loose connection', ''),
	(82, 'Stack of labels falling  over', 5, '1) Static brush position.  2) Platform angle.  3) Tip stacker .', '1) Move static brush up or down.  2) Move to other position.  3) Change angle', ''),
	(83, 'Label not entering  stacker', 5, '1) Label jam in knife.  2) Nip roller not pulling.  3) Soft material / narrow web hitting static brush', '1) Clean out label and debris.  2) Worn rubber roller - Replace.  2.1) Loose set screw or drive gear - Tighten.  3) Adjust the height of the static brush', ''),
	(84, 'LEDs do not light.', 7, '1) Incorrect supply voltage.  2) Machine is not plugged in.  3) Missing or blown fuse(s).', '1) Confirm that the AC entry is configured for the line voltage intended to be applied to the machine.  Failure to do so can damage the machine\'s internal power supply.  Refer to Appendix 1, "Fuse Configuration."  2) Check that both ends of the power cord are \r\nplugged in securely.  2.1) Confirm that the outlet the machine is plugged into has power.  3) Check that the fuse(s) located inside the \r\nAC entry are present and intact.  Replace as needed.  Refer to Appendix 1, "Fuse Configuration.” ', ''),
	(85, 'LEDs flash ', 7, '1) PC board power failure', '1) Cycle the power off and back on again.', ''),
	(86, 'Printer says “Boot Error 1”  or “Hardware error 1,  printer requires service”  or “PCI interface bad  change MCB”.  During  the power up of the  printer.', 7, '1) PCB failure.  2) Motherboard failure ', '1) Replace MCB board.  2) Replace motherboard ', ''),
	(87, 'Printer says “Boot Error 2”  or “Hardware error 2,  printer requires service”  or “BIOS corrupted,  replace the mother  board” or “Reset the  BIOS”. During the power  up of the printer.', 7, '1) Corrupted BIOS.  2) Motherboard failure.', '1) Connect a standard PC monitor and keyboard to the printer and follow the instructions found in the Engineering Bulletin “06_015_500_BIOS_Revised.doc” to reset the BIOS settings.  2) Replace motherboard', ''),
	(88, 'Printer says “Boot Error 3”  or “Hardware error  three” during power up.  Printer requires service.  Corrupted safe  operating system.  Replace the flash disk”.  (Message depends on  software version.) ', 7, '1) Flash Disk Failure.  2) Motherboard Failure.', '1) Replace Flash Disk Module.  2) Replace motherboard', ''),
	(89, 'Printer says “Boot Error 4”  or “Hardware error 4.  Printer requires service”  or “Cannot  communicate with the  MCB. Change the MCB”  during power up.  (Message depends on  software version.) ', 7, '1) PCB failure .  2) Motherboard Failure. ', '1) Replace MCB Board.  2) Replace motherboard', ''),
	(90, 'Printer says “Running  Backup Operating  System.  Please  upgrade” after power  up. (Message depends  on software version.)', 7, '1) Upgrade failure ', '1) Upgrade to the latest operating system.', ''),
	(91, 'Printer says “Running  Safe Operating System.   Please upgrade” after  power up. (Message  depends on software  version.) ', 7, '1) Software failure', '1) Upgrade to the latest operating system.  NOTE: The safe operating system will run the printer, but it does not have the latest features and improvements.  Upgrade as soon as possible. ', ''),
	(92, 'Machine does not receive  data.', 7, '1) Communications cable is loose or unconnected.  2) Incompatible communication cable.  3) Machine is not powered on or \r\nhas not completed diagnostics tests.  4) Data sent to wrong printer.  5) Configuration incorrect in PCMate Platinum .  6) Faulty Mother Board ', '1) Check and secure both ends of the serial cable with the thumbscrews.  2) Ensure the communication cable is a null \r\nmodem serial cable with DB9F connector.  3) Power machine on and wait until machine ready light is on.  Re-download data.  4) In PCMate Platinum change to the printer where the data is intended to be sent.  5) Reconfigure PCMate Platinum for AVERY DENNISON PCL printer as per your PCMate Platinum manual.  6) Replace the Mother Board.', ''),
	(93, 'Stock or ink does not  advance when the  start button is  depressed. ', 7, '1) No batches to be printed. (Data light is not on.)  2) An interlock condition exists. (Supply or Error light is on.)  3) Stock is bound.  4) Ink is bound.', '1) Download batch (If batch downloaded uses the same design as a previously downloaded batch, the machine will start automatically). 2) Press the voice button to determine the error.  2.1) If using PCMate Platinum, check the virtual control / display. 3) Remove and rethread the stock.   4) Remove and rethread the ink.  ', ''),
	(94, 'Stock advances but the  printer does not print.', 7, '1) Stock registration sensor is misaligned (preprinted stocks only).   2) Print head cable is disconnected or faulty.  3) Print head is faulty.  4) Stock and Ink Transfer Type selection in Design File doesn’t match supplies.  ', '1) Re-align sense mark with sensor, refer to section 3.3.6.2 Sensors.  2) Power off the machine and reinsert the print head connector or replace the cable.  3) Replace the print head.  4) Refer to the PCMate Platinum software manual.', ''),
	(95, 'Machine stops after  every third label.', 7, '1) Stock registration sensor is misaligned (preprinted stocks only).  2) Label length selection in the Design File doesn’t match the printed stock length.', 'Refer to the PCMate Platinum software \r\nmanual.', ''),
	(96, 'Print registration is off in  the feed direction.', 7, '1) Print position is incorrect.  2) Field(s) position incorrect in the Design File.  3) Sense–to–cut selection in the Design File is incorrect.\r\n4) Bound print roller. ', '1) Use the Virtual Control / Display or adjust the print position.  2) Refer to PCMate Platinum software manual. 3) Refer to PCMate Platinum software manual.  4) Check that the print roller turns freely on its shaft.  If it does not, replace it.', ''),
	(97, 'Print registration is off in  the web direction.', 7, '1) Machine is incorrectly threaded.  2) Web guides incorrectly adjusted.  3) Stock Arbor is not tight.', '1) Check and rethread the media as needed.  Refer to section 3.1.3 Loading the Stock.  2) Check and adjust web guides as needed.  \r\nRefer to section 6.2, Stock (Web) Guide Width Adjustments. 3) Check and adjust as needed.  Refer to section 3.1 Loading Supplies.', ''),
	(98, 'Print density is too light  or too dark.', 7, '1) Stock and Ink Transfer Type selection in Design File doesn’t match supplies.  2) Incorrect contrast setting in the machine setup.\r\n3) Misadjusted print head pressure.', '1) Refer to the PCMate Platinum software manual.  2) Adjust the contrast control on each print head.  Refer to section 4.1 Print Head Adjustments.  3) Set print head pressure.  Refer to section 4.1 Print Head Adjustments.', ''),
	(99, 'Voids in print image in  the feed direction. ', 7, '1) Ink is misaligned with the stock.  2) Print head is dirty.  3) Faulty print head.  4) Misadjusted print head pressure.  5) Worn printer roller.', '1) Ink must be 1/4” or 5 mm wider than the stock.  Example: 1”(25 mm) web requires  1 ¼” (30 mm) ink.  2) Power off the machine. Clean the print head and print.  Refer to section 5.1, Print Head Cleaning and Handling.  3) After cleaning the print head and running a test label, if a void still exists, replace the print head.   4) Set print head pressure.  Refer to section 4.1.1, Adjusting Print Head  5) Contact your local AVERY DENNISON representative. Pressure.', ''),
	(100, 'Machine fails to cut  labels (the rotary  knife does not rotate).', 7, '1) The knife is disabled.  2) Cut count is set to “0” in the Design File.  ', '1) Enable the knife in the setup menu via the Virtual Control / Display in PCMate Platinum section 8.0.   2) Refer to the PCMate Platinum software manual. ', ''),
	(101, 'The stacker platform  fails to run. ', 7, '1) The stacker cable is disconnected. ', '1) Power off the machine and insert the stacker cable in the stacker port.', ''),
	(102, 'Labels will not stack.', 7, '1) Stacker is not operating.  2) Stacker position on the machine too high or too low.  3) Incorrect position platform bed angle.', '1) Be sure the nip roller is free to rotate.  2) Move the toggle switch to the opposite position.  3) Use the pull pin to change the platform \r\nangle. ', ''),
	(103, 'Knife does not cut  completely through. ', 7, '1) Knife blade shear is misaligned.', '1) Refer to section 6.4, Knife Shear \r\nAdjustment.', ''),
	(104, 'Knife will not cut.', 7, '1) Knife blades are dull. ', '1) Refer to section 5.4.1, Removing and \r\nReplacing the Knife assembly. ', ''),
	(105, 'KNIFE DID NOT HOME', 7, 'Knife Error.  Press start to continue.', 'The knife did not complete the cut properly, or the \r\nknife could not initialize properly.  Try again.  If this \r\nhappens frequently or continuously, the knife needs \r\nservice', ''),
	(106, 'STACKER FULL ', 7, 'The stacker is full.  \r\nRemove labels from \r\nthe stacker. ', 'The stacker is full.  Remove all labels from the \r\nstacker.  If this error occurs when there are no labels \r\non the stacker, the stacker requires service. ', ''),
	(107, 'Stacker sensor error.   Remove labels from  the stacker.', 7, 'STACKER SENSOR ERROR', 'This error occurs when the stacker tries to position \r\nthe platform before printing.  The platform position \r\nsensor did not respond as expected.  This is usually \r\ncaused by labels blocking the sensor.  Remove all \r\nlabels from the platform and try again.  If the error \r\nstill occurs, the stacker requires service.', ''),
	(108, 'OPEN TOP (BOTTOM)  PRINTHEAD', 7, 'Open the top \r\n(bottom) print station \r\nfor a single sided \r\nformat ', 'The SNAP printers are capable of printing on either \r\nthe top or bottom printheads, both, or neither (cut \r\nonly). The unused print station roller(s) must be \r\nopen..  This eliminates the need to install ink on the \r\nunused station.  If this error occurs when the bottom \r\nstation roller is open, the head open sensor is not \r\nworking.', ''),
	(109, 'ST1 (2) LOW TEMP READ  ERR', 7, 'Lower (Upper) print \r\nstation error.  Printer \r\nrequires service.', 'This error indicates that the upper or lower printhead \r\ntemperature is out of normal range.  This is generally \r\ncaused by a disconnected printhead.  Check the \r\nprinthead connections.  If the error still occurs, \r\nchange the printhead.  If the error still occurs, replace \r\nthe printhead cable.  If the error still occurs, replace \r\nthe MCB.', ''),
	(110, 'MCB CMD_FRE INDEX ERR', 7, 'Internal error.  Press \r\nstart to continue.', 'These are internal software errors.  If one of them \r\noccurs, clear the error and continue.  If the error \r\ncontinues to occur, report the error and the \r\ncircumstances that cause it to Avery Dennison \r\nService.  These errors are caused by errors in the \r\nsoftware and are not caused by hardware failures.', ''),
	(111, 'MCB CMD_FSE INDEX ERR', 7, 'Internal error.  Press \r\nstart to continue.', 'These are internal software errors.  If one of them \r\noccurs, clear the error and continue.  If the error \r\ncontinues to occur, report the error and the \r\ncircumstances that cause it to Avery Dennison \r\nService.  These errors are caused by errors in the \r\nsoftware and are not caused by hardware failures.', ''),
	(112, 'MCB BAD STACK ERROR', 7, 'Internal error.  Press \r\nstart to continue. ', 'These are internal software errors.  If one of them \r\noccurs, clear the error and continue.  If the error \r\ncontinues to occur, report the error and the \r\ncircumstances that cause it to Avery Dennison \r\nService.  These errors are caused by errors in the \r\nsoftware and are not caused by hardware failures. ', ''),
	(113, 'MCB KNF FLIT TBL TOO  BIG', 7, 'Internal error.  Press \r\nstart to continue.', 'These are internal software errors.  If one of them \r\noccurs, clear the error and continue.  If the error \r\ncontinues to occur, report the error and the \r\ncircumstances that cause it to Avery Dennison \r\nService.  These errors are caused by errors in the \r\nsoftware and are not caused by hardware failures.', ''),
	(114, 'MCB KNIFE STATE TOO  BIG', 7, 'Internal error.  Press \r\nstart to continue.', 'These are internal software errors.  If one of them \r\noccurs, clear the error and continue.  If the error \r\ncontinues to occur, report the error and the \r\ncircumstances that cause it to Avery Dennison \r\nService.  These errors are caused by errors in the \r\nsoftware and are not caused by hardware failures. ', ''),
	(115, 'MCB BEMF MON ST TOO  BIG', 7, 'Internal error.  Press \r\nstart to continue.', 'These are internal software errors.  If one of them \r\noccurs, clear the error and continue.  If the error \r\ncontinues to occur, report the error and the \r\ncircumstances that cause it to Avery Dennison \r\nService.  These errors are caused by errors in the \r\nsoftware and are not caused by hardware failures. ', ''),
	(116, 'MCB STACKR HM ST TOO  BIG ', 7, 'Internal error.  Press \r\nstart to continue.', 'These are internal software errors.  If one of them \r\noccurs, clear the error and continue.  If the error \r\ncontinues to occur, report the error and the \r\ncircumstances that cause it to Avery Dennison \r\nService.  These errors are caused by errors in the \r\nsoftware and are not caused by hardware failures. ', ''),
	(117, 'MCB KNF HOME ST TOO  BIG', 7, 'Internal error.  Press \r\nstart to continue. ', 'These are internal software errors.  If one of them \r\noccurs, clear the error and continue.  If the error \r\ncontinues to occur, report the error and the \r\ncircumstances that cause it to Avery Dennison \r\nService.  These errors are caused by errors in the \r\nsoftware and are not caused by hardware failures.', ''),
	(118, 'MCB BEMF CTRL ST TOO  BIG ', 7, 'Internal error.  Press \r\nstart to continue. ', 'These are internal software errors.  If one of them \r\noccurs, clear the error and continue.  If the error \r\ncontinues to occur, report the error and the \r\ncircumstances that cause it to Avery Dennison \r\nService.  These errors are caused by errors in the \r\nsoftware and are not caused by hardware failures. ', ''),
	(119, 'MCB SHE BATCH Q  OVERFLOW ', 7, 'Internal error.  Press \r\nstart to continue. ', 'These are internal software errors.  If one of them \r\noccurs, clear the error and continue.  If the error \r\ncontinues to occur, report the error and the \r\ncircumstances that cause it to Avery Dennison \r\nService.  These errors are caused by errors in the \r\nsoftware and are not caused by hardware failures.', ''),
	(120, 'MCB FVE INDEX ERROR', 7, 'Internal error.  Press \r\nstart to continue', 'These are internal software errors.  If one of them \r\noccurs, clear the error and continue.  If the error \r\ncontinues to occur, report the error and the \r\ncircumstances that cause it to Avery Dennison \r\nService.  These errors are caused by errors in the \r\nsoftware and are not caused by hardware failures.', ''),
	(121, 'MCB ERROR #58 #59 #60 #64 #68 #69 #70 #91 #95 #97 #98 #99', 7, 'Internal error.  Press \r\nstart to continue.', 'These are internal software errors.  If one of them \r\noccurs, clear the error and continue.  If the error \r\ncontinues to occur, report the error and the \r\ncircumstances that cause it to Avery Dennison \r\nService.  These errors are caused by errors in the \r\nsoftware and are not caused by hardware failures.', ''),
	(122, 'OUT OF MEMORY  IMAGER ERROR         919', 7, 'Internal error.  Press \r\nstart to continue.', 'These are internal errors similar to the ones above.  \r\nHowever, these errors will require power cycling the \r\nprinter.  If the error continues to occur, report the \r\nerror and the circumstances that cause it to Avery \r\nDennison Service.', ''),
	(123, 'LBL TOO SHORT FOR  SPEED ', 7, 'Knife cycle error.  \r\nIncrease label length \r\nor select a slower \r\nprint speed.', 'This error indicates that the label is shorter than the \r\nminimum length for the selected print speed.  Refer \r\nto the Printer Specifications for minimum label \r\nlengths.  (Minimum label lengths are different for the \r\nSonic Knife.  Refer to the Sonic Knife manual.)  To \r\nrun and cut the label, you must either make the label \r\nlonger or reduce the print speed. ', ''),
	(124, 'STOCK OUT', 7, 'The stock supply roll \r\nis empty', 'This error indicates the stock supply roll is empty.  If \r\nthe stock supply roll is not empty, make sure the \r\nsupply core is firmly held by the arbor clamp. \r\nIf this error continues to occur, remove the stock roll \r\nand press the Start button (the Ready light must be \r\non).  The stock arbor should spin counter-clockwise \r\nbriefly.  If it doesn’t, the motor or MCB is defective.  If \r\nit spins and you continue to get the error after re-\r\ninstalling the stock roll, the MCB is defective.', ''),
	(125, 'INK OUT BOTTOM (TOP) ', 7, 'The lower (upper) \r\nprint station ink roll is \r\nempty', 'This error indicates that the ink on the specified print \r\nstation is either missing or broken, or the supply roll \r\nis empty. \r\nIf this error continues to occur even though the ink \r\nsupply rolls are properly installed, remove the ink \r\nrolls and press the Start button.  The unwind (supply) \r\narbor should spin counter-clockwise and the rewind \r\n(take-up) arbor should spin clockwise briefly.  If one \r\nor both of the motors does not spin, the motor(s) or \r\nMCB are defective.  If both motors spin, install a new \r\nink roll.  If the error continues to occur with the new \r\nink roll, the MCB is defective.', ''),
	(126, 'HEAD OPEN BOTTOM  (TOP)', 7, 'The lower (upper) \r\nprint station roller is \r\nopen', 'This error indicates that either the upper or lower \r\nplaten roller is open.  Close the roller.  If the error \r\ncontinues to occur when the roller is closed, check \r\nthe roller open sensor.', ''),
	(127, 'MISSED SENSE MARK', 7, 'Missed sense mark', 'The format specifies a sense mark, but no sense \r\nmark was found.  Possible causes are misalignment \r\nof the sensor to the sense mark or incompatibility of \r\nthe sense mark and the sensor type.  Another \r\npossible cause is a mismatch between the label \r\nlength that is set in the format with the actual \r\ndistance between sense marks on the stock. \r\nNOTE: In later versions of code, this message is \r\nreplaced by the following messages that specify the \r\ntype of sensor. This gives more information in case \r\nthe wrong sensor type is selected.', ''),
	(128, 'MISSED HOLE  SENSEMARK ', 7, 'Missed hole sense \r\nmark', 'The format specifies a hole sense mark, but no \r\nsense mark was found.  Possible causes are \r\nmisalignment of the sensor to the sense mark or \r\nincompatibility of the sense mark and the sensor \r\ntype.  Another possible cause is a mismatch between \r\nthe label length that is set in the format with the \r\nactual distance between sense marks on the stock. If \r\nthe format does not specify a hole sense mark, the \r\nsensor type override may be set.', ''),
	(129, 'MISSED T REFL  SENSEMARK', 7, 'Missed top reflective \r\nsense mark', 'The format specifies a top reflective sense mark, but \r\nno sense mark was found.  Possible causes are \r\nmisalignment of the sensor to the sense mark or \r\nincompatibility of the sense mark and the sensor \r\ntype.  Another possible cause is a mismatch between \r\nthe label length that is set in the format with the \r\nactual distance between sense marks on the stock. If \r\nthe format does not specify a top reflective sense \r\nmark, the sensor type override may be set.', ''),
	(130, 'MISSED B REFL  SENSEMARK', 7, 'Missed bottom \r\nreflective sense mark', 'The format specifies a bottom reflective sense mark, \r\nbut no sense mark was found.  Possible causes are \r\nmisalignment of the sensor to the sense mark or \r\nincompatibility of the sense mark and the sensor \r\ntype.  Another possible cause is a mismatch between \r\nthe label length that is set in the format with the \r\nactual distance between sense marks on the stock. If \r\nthe format does not specify a bottom reflective sense \r\nmark, the sensor type override may be set. ', ''),
	(131, 'MISSED CONTR  SENSEMARK ', 7, 'Missed contrast \r\nsense mark ', 'The format specifies a contrast sense mark, but no \r\nsense mark was found.  Possible causes are \r\nmisalignment of the sensor to the sense mark or \r\nincompatibility of the sense mark and the sensor \r\ntype.  Another possible cause is a mismatch between \r\nthe label length that is set in the format with the \r\nactual distance between sense marks on the stock. \r\nAlso, the contrast sensor option may not be installed. \r\nIf the format does not specify a contrast sense mark, \r\nthe sensor type override may be set.', ''),
	(132, 'HEAD 1 OR 2 OVER TEMP', 7, 'The lower (upper) \r\nprint head is \r\noverheated.  Wait \r\nuntil the error light to \r\ngo out then press \r\nstart to continue', 'The printer continuously monitors the temperature of \r\nthe printhead to ensure it doesn’t overheat and \r\ndamage the printhead.  When the printhead \r\ntemperature reaches a pre-set limit, the printer will \r\nstop with this error.  Wait for the error light to go out \r\nand continue printing.  However, it is likely that the \r\nerror will happen again.  Possible solutions are to \r\nreduce the print speed or to reduce the amount of \r\ncopy on the label. \r\nIf this error happens when the printer is first turned \r\non or does not clear itself within a few minutes, the \r\nprinthead or MCB may be defective.', ''),
	(133, 'SENSOR CAL ERROR', 7, 'Sensor Calibration \r\nError', 'When first running a format specifying a particular \r\nsensor, or after a missed sense mark error, the \r\nprinter automatically calibrates the sensor. This error \r\nindicates that the printer could not calibrate the \r\nsensor. Possible causes are misalignment of the \r\nsensor to the sense mark or incompatibility of the \r\nsense mark and the sensor type. NOTE: In later \r\nversions of firmware, this message is replaced with \r\nthe ones below, which indicate the selected sensor \r\ntype. This gives more information in case the wrong \r\nsensor type is selected.', ''),
	(134, 'HOLE SENSEMARK CAL  ERROR ', 7, 'Hole sense mark \r\ncalibration error', 'When first running a format specifying a hole sense \r\nmark, or after a missed sense mark error, the printer \r\nautomatically calibrates the sensor. This error \r\nindicates that the printer could not calibrate the \r\nsensor. Possible causes are misalignment of the \r\nsensor to the sense mark or incorrect sensor type ', ''),
	(135, 'T REFL SENSEMARK CAL  ERROR', 7, 'Top reflective mark \r\ncalibration error', 'When first running a format specifying a top reflective \r\nsense mark, or after a missed sense mark error, the \r\nprinter automatically calibrates the sensor. This error \r\nindicates that the printer could not calibrate the \r\nsensor. Possible causes are misalignment of the \r\nsensor to the sense mark or incorrect sensor type', ''),
	(136, 'B REFL SENSEMARK CAL  ERROR', 7, 'Bottom reflective \r\nmark calibration error', 'When first running a format specifying a bottom \r\nreflective sense mark, or after a missed sense mark \r\nerror, the printer automatically calibrates the sensor. \r\nThis error indicates that the printer could not calibrate \r\nthe sensor. Possible causes are misalignment of the \r\nsensor to the sense mark or incorrect sensor type', ''),
	(137, 'CONTR SENSEMARK CAL  ERROR ', 7, 'Contrast sense mark \r\ncalibration error', 'When first running a format specifying a contrast \r\nsense mark, or after a missed sense mark error, the \r\nprinter automatically calibrates the sensor. This error \r\nindicates that the printer could not calibrate the \r\nsensor. Possible causes are misalignment of the \r\nsensor to the sense mark or incorrect sensor type. \r\nAlso, the contrast sensor option may not be installed', ''),
	(138, 'VERIFIER HALT 1 (2)      912  (Note: there is no difference  between 1 and 2)', 7, 'Bar code failure', 'This indicates that the bar code verifier found a bad \r\nbar code.  The most likely cause is a print quality \r\nproblem such as an ink wrinkle or a dot out on the \r\nprinthead.  If this error happens on every label, check \r\nthe printhead for dots out.  If this error happens often, \r\nbut not every label, check the bar code minimum \r\nheight requirement or lower the ANSI grade.', ''),
	(139, 'BUFFER OVERFLOW  SERIAL COMM OVERFLOW', 7, 'Communication error.  \r\nPress start to \r\ncontinue.', 'This error indicates that the host computer sent more \r\ndata than the printer can handle.  This error is \r\ngenerally caused by a mismatch in the serial protocol \r\nsetting (XON/XOFF or RTS/CTS) between the printer \r\nand the host, or a cable that does not have the \r\nRTS/CTS lines. \r\nNOTE: Later versions of firmware use the SERIAL \r\nCOMM OVERFLOW message to indicate that the \r\nproblem is in the serial communications. ', ''),
	(140, 'TOO MANY FIELDS ', 7, 'N/A', 'The number of fields on the label exceeds the \r\nmaximum number allowed.', ''),
	(141, 'SOFTWARE MISMATCH', 7, 'The imager and MCB \r\nsoftware versions are \r\nnot compatible', 'The printer checks to make sure the software \r\nversions within the printer are compatible.  This error \r\nindicates that the versions are not compatible.  \r\nUpgrade to the latest operating system software. ', ''),
	(142, 'MCB ERROR #61 #62 #63 #65 #66 #67 #71 #72  #73 #74  #78 #79 #80 #84 #85 #86  #87 #88 #89 #88 #89 #91 #92 #93 #94 #100', 7, 'Internal error.  Press \r\nstart to continue.', 'These errors are all related to identification devices \r\nin the printer or peripherals that are used to read the \r\nprinter configuration.  If one of these errors continues \r\nto occur after a power cycle, disconnect all \r\nperipherals (stacker, sonic knife, etc.).  If the problem \r\nstill occurs, replace the Frame ID memory.  If it still \r\noccurs, replace the MCB. \r\nIf disconnecting the peripherals fixes the problem, re-\r\nconnect one at a time to determine which one is \r\ncausing the problem, then replace the printer \r\ninterface harness. ', ''),
	(143, 'MCB ID NOT FOUND ', 7, 'Internal error.  Press \r\nstart to continue.', 'These errors are all related to identification devices \r\nin the printer or peripherals that are used to read the \r\nprinter configuration.  If one of these errors continues \r\nto occur after a power cycle, disconnect all \r\nperipherals (stacker, sonic knife, etc.).  If the problem \r\nstill occurs, replace the Frame ID memory.  If it still \r\noccurs, replace the MCB. \r\nIf disconnecting the peripherals fixes the problem, re-\r\nconnect one at a time to determine which one is \r\ncausing the problem, then replace the printer \r\ninterface harness.', ''),
	(144, 'FRAME ID NOT FOUND ', 7, 'Internal error.  Press \r\nstart to continue.', 'These errors are all related to identification devices \r\nin the printer or peripherals that are used to read the \r\nprinter configuration.  If one of these errors continues \r\nto occur after a power cycle, disconnect all \r\nperipherals (stacker, sonic knife, etc.).  If the problem \r\nstill occurs, replace the Frame ID memory.  If it still \r\noccurs, replace the MCB. \r\nIf disconnecting the peripherals fixes the problem, re-\r\nconnect one at a time to determine which one is \r\ncausing the problem, then replace the printer \r\ninterface harness.', ''),
	(145, 'MCB ERROR #96', 7, 'Internal error.  Press \r\nstart to continue.', 'This error is related to the Security Batch Count \r\nfeature.  It indicates that the Batch Count queue is \r\nfull, which should never happen.  The only way to \r\nrecover from this is to reset the MCB by removing the \r\nbattery on the MCB with the power off, then replacing \r\nit.  This will also reset all the printer settings (print \r\nand cut adjust, baud rate, cutter enable, etc.) to their \r\ndefault values.', ''),
	(146, 'Stock will not roll  smoothly or the stock  jumps.', 7, '1) Web guides are incorrectly \r\nadjusted.\r\n2) Unwind back tension to high.\r\n3) Print head pressure is too \r\nhigh. \r\n4) Printer is not threaded \r\ncorrectly. ', '1a) Be sure stock roll is as flat as possible \r\nand does not extend over core. \r\n1b) Adjust web guides to touch stock roll, but \r\ndo not pinch the roll. \r\n2a) Reduce the unwind back tension through \r\nthe virtual panel. \r\n3a) Reduce the print head pressure. \r\n \r\n4a) Check threading diagram and correct as \r\nneeded.', ''),
	(147, 'Stock will not track  straight through the  printer.', 7, '1) Web guides are too loose. \r\n \r\n2) Material is telescoping of the \r\nunwind. \r\n \r\n3) Machine not on a level \r\nsurface.   \r\n4) Printer is threaded incorrectly.', '1a) Adjust web guides to touch outer edges of \r\nstock with the minimum pressure required. \r\n2a) Remove stock supply and tension roll on a \r\nflat surface by pulling on the end of the \r\nmaterial and holding the core from turning. \r\n3a) Level the printer or work table. \r\n \r\n4a) Check threading diagram and correct', ''),
	(148, 'Stock jams in bridge  blade rollers or knife  area.', 7, '1) Knife not cutting the full width \r\nof stock.\r\n2) Nip rollers are not turning. ', '1) Refer to section 6.4, Knife Shear \r\nAdjustment.\r\n2) Be sure the nip roller is free to rotate and \r\nmoves easily in the bearing slots.  Check for \r\na loose drive gear.', ''),
	(149, 'Ink wrinkles or will not  pull smoothly.', 7, '1) Ink supply and rewind rolls are \r\nmisaligned.\r\n2) Ink buildup on the turn bar(s).\r\n3) Incorrect ink width.\r\n4) Needs more back tension\r\n', '1a) Make sure rewind core is equal to or wider \r\nthan the supply roll width.\r\n1b) Check that the motor is working and has \r\nback tension on the supply roll.\r\n2a) Clean the turn bar(s) with alcohol.\r\n3a) Use an ink width ¼” (5 mm) wider than the \r\nstock being printed on.\r\n4a) Increase back tension through the virtual \r\npanel.\r\n', ''),
	(150, 'Ink breaks', 7, '1) Head needs cleaning', '1a) See cleaning instruction section 5.1', ''),
	(151, 'Ink rolls loosely on  Rewind core.', 7, '1) Ink rewind roll not turning.\r\n2) Ink rewind roll is too full.', '1) Check that the motor is working.\r\n2) Remove ink rewind roll.  Replace ink \r\nrewind roll with an empty core.', ''),
	(152, 'Poor print – uneven or  no print.', 7, '1) Print head pressure is too \r\nlight.\r\n2) Ink rewind roll is too full.', '1) Move pressure buttons to increase the \r\npressure. \r\n1.1) Ensure that both pressure buttons are set \r\nto the same height. \r\n2) Remove ink rewind rolls and replace with \r\nempty cores. ', ''),
	(153, 'Knife stops during cut in  stock.', 7, '1) Knife blades are dull. ', '1) Refer to section 5.4.1, Removing and \r\nReplacing the Knife Assembly.', ''),
	(154, 'Stock is popping in front  of the knife. ', 7, '1) Knife blades are dull.', '1) Refer to section 5.4.1, Removing and \r\nReplacing the Knife Assembly.', ''),
	(155, 'Stacker fails to move up  or down when start  button is depressed.', 7, '1) Interface cable', '1) Not plugged in all the way. \r\n2) Just installed and needs to be power cycled \r\nfor printer to identify option installed. \r\n3) Printer has no batches to print. ', ''),
	(156, 'Platform cannot find  home ', 7, '1) Sensor unplugged.\r\n2) Sensor out of alignment.\r\n', '1) Remove back cover and check \r\nconnections. \r\n1.1) Broken wire or damaged LED\r\n2) Outer bracket bent and needs to be \r\nreformed.', ''),
	(157, 'Top of stack is blocking  incoming labels ', 7, 'Sensor not operational ', '1) Check sensor alignment \r\n2) Stacker not connected \r\n3) Loose connection ', ''),
	(158, 'Stack of labels falling  over', 7, '1) Static brush position\r\n2) Platform angle\r\n3) Tip stacker', '1) Move static brush up or down\r\n2) Move to other position\r\n3) Change angle', ''),
	(159, 'Label not entering  stacker ', 7, '1) Label jam in knife\r\n2) Nip roller not pulling \r\n3) Soft material / narrow web \r\nhitting static brush', '1) Clean out label and debris\r\n2) Worn rubber roller - Replace \r\n2.1) Loose set screw or drive gear - Tighten \r\n3) Adjust the height of the static brush', ''),
	(160, 'Web will not advance', 2, '1) Insufficient feed pressure.  2) Defective feed component. ', '1) Check for broken spring. 1.1) Spring is off pressure mount pin. 1.2) Clean ink build up from grit rollers. 1.3) Check for thread fiber in feed roller bearings.  2) Check for loose or broken feed timing belt. Make sure the timming belt is not tight.  Run with 1/8” (3mm) side to side free play total ¼” (6mm). 2.1) Check for loose setscrews on feed motor or grit roller driven shaft. 2.2) Check for worn bearings. 2.3) Worn feed or pressure grit rollers. 2.4) Rheostat out of adjustment – Call for service support.  2.5) Defective feed motor. 2.6) Motor runs for a while and loses power.  Let system cool and it works. – check room temperature to spec.  DC motors loose power if overheated. ', ''),
	(161, 'Web will not sublimate  completely', 2, '1) IR lamp(s) out. 2) Defective IR sensor. 3) Defective sensor controller. 4) Blocked filters. 5) Web is not tracking through \r\nthe middle of the heat chamber. ', '1) Replace blown lamp(s). 1.1) Inspect wire leads from lamps . 1.2) Check for loose terminal block connection. 2) Replace. 3) Replace.  4) Replace filters. 5) Move the LOKPRINT II so the web tracks in the center of the heat lamps.  5.1)  Check feed springs and replace', ''),
	(162, 'Smoke coming from the front  of Heat Chamber.', 2, '1) Blocked filter.  2) Fan not operational.  3) Web broken or fallen on IR lamps causing excessive build up on lamps', '1) Replace filter(s).  2) Check blown fuse. 2.1) Replace defective fan. 3) Stop system and allow the build up to \r\nburn off.', ''),
	(163, 'No lights on / in LOKRPINT II  Check Stacker error cannot be  cleared.  System will not start.', 2, '1) Power switch position.  2) Power switch over current trip. 3) Outlet / power fault. ', '1) Toggle power switch on back of LOKRPINT II box.  2) Confirm power switch rating matches \r\nmachine line voltage. 2.1) Check lamp-wiring matches machine line voltage. 2.2) Check SCR Controller strapping \r\nmatches machine line voltage. 3) Plant electrician.', ''),
	(164, 'READY light is not on.  Check  Stacker error cannot be  cleared.  System will not start.', 2, '1) Insufficient time since the Fuji sensed the top of the inner oven at 400º.  2) READY light bulb fault.  3) Wiring error / fault. 4) U1 Controller programming error. 5) U1 offset error. 6) U2 Monitor programming error.  7) U2 offset error.  8) SP / SP2 switch bale \r\nmisalignment or fault. 9) Oven lamp wiring error / fault. 10) U2 Sensor fault.  11) U2 Monitor fault.  12) U1 Sensor fault. 13) U1 Controller fault.', '1) Wait 8 minutes after the C light on the Fuji turns on.  2) Evaluate / replace bulb as needed. 3) Confirm proper connection of 7-pin \r\nconnector between the LOKRPINT II and the 676. 3.1) Confirm wiring of all component(s) that were replaced.  4) AVERY DENNISON service to confirm / reprogram as needed.  5) AVERY DENNISON service to confirm / set exit temperature as needed. 6) AVERY DENNISON service to confirm / reprogram as needed.  7) AVERY DENNISON service to confirm / set offset as needed.  8) Adjust / evaluate / replace oven position switch. 9) Check lamp wiring matches machine line voltage / evaluate / replace as needed.  10) Evaluate / replace sensor, requires AVERY DENNISON service to confirm / set exit temperature as needed.  11) Evaluate / replace U2, requires AVERY DENNISON service to confirm / set exit temperature as needed. 12) Evaluate / replace sensor, requires \r\nAVERY DENNISON service to confirm / set exit temperature as needed.  13) Evaluate / replace U1, requires AVERY \r\nDENNISON service to confirm / set exit temperature as needed. ', ''),
	(165, 'READY light is on.  Check  Stacker error can be cleared.   Oven travels out or attempts to  travel out and immediately  retracts.', 2, '1) Oven obstacle.  2) Oven to guard insulation strip misalignment.  3) Oven drive line fault, mechanical or electrical. 4) No web.  5) Web not centered in web sensor. 6) Web sensor IR shield missing. 7) Web sensor / wiring fault.', '1) Remove / adjust obstacle so that oven travels freely.  2) Adjust insulation strip for full oven engagement without interference.  3) Adjust sensor for proper oven position / evaluate / replace sensor. 4) Evaluate the drive line for mechanical binds / problems.  4.1) Confirm proper connection of 15-pin connector between the LOKPRINT II and the 676. 5) Thread the web through the LOKPRINT II\r\n6) Center the web in the LOKPRINT II web sensor.  7) Reinstall the IR shield.  8) Evaluate / replace the web sensor. ', ''),
	(166, 'System stops during batch  READY light goes out.  Check Stacker error cannot be  cleared for 8 minutes.  System  will not start.', 2, 'U1 Controller programming error. U1 offset error. U2 Monitor programming error. U2 offset error. Oven lamp wiring error / fault. U1 Sensor fault. U2 Sensor fault. U1 Controller fault. U2 Monitor fault. ', 'AVERY DENNISON service to confirm / set SP2 as needed. AVERY DENNISON service to confirm / set exit temperature as needed. AVERY DENNISON service to confirm / reprogram as needed.  AVERY DENNISON service to confirm / set offset as needed.  Evaluate the four lamps / wiring / replace as needed.  Evaluate / replace sensor, requires AVERY DENNISON service to confirm / set exit temperature as needed.  Evaluate / replace sensor, requires AVERY DENNISON service to confirm / set exit temperature as needed.  Evaluate / replace U1, requires AVERY DENNISON service to confirm / set exit temperature as needed.  Evaluate / replace U2, requires AVERY DENNISON service to confirm / set exit temperature as needed.', ''),
	(167, 'READY light is on. Check  Stacker error cannot be  cleared. System will not start.', 2, 'LOKPRINT II guard open.  Finishing Station stacker platform \r\nat bottom of its travel. \r\nWeb present sensor is not \r\ncovered by the web \r\nWeb tension assembly at the end \r\nof the printer sensor is not \r\ntriggered ', '1) Close guard.  2) Guard switch out of adjustment. Remove labels and raise platform. \r\n \r\nMove LKP II so the web tracks in the \r\nmiddle of the feed roller \r\nWeb is not threaded through tension \r\ndevice correctly – see threading in this \r\ndocument. \r\nSensor arm on the cam is not setting in \r\nthe low setting when arm is in the up \r\nposition – adjust cam location', ''),
	(168, 'Finishing Station displays  Close Guard.', 2, 'Finishing Station guard open.', 'Close guard.', ''),
	(169, 'U1 readout > 800º.', 2, 'U1 Sensor misalignment.  U1 Controller programming error.  U1 Sensor fault.  U1 Controller fault.  SCR fault.', 'AVERY DENNISON realign sensor.  AVERY DENNISON service to confirm / \r\nreprogram as needed.   Evaluate / replace IR sensor, requires \r\nAVERY DENNISON service to confirm / \r\nset exit temperature as needed.  Evaluate / replace  \r\nU1, requires AVERY DENNISON \r\nservice to confirm / set exit temperature \r\nas needed.   Evaluate / replace SCR.', ''),
	(170, 'READY light is on.  Oven travels out or attempts to travel out and immediately  retracts. Check stacker error  can be cleared.', 2, 'Oven out sensor mis-adjustment.  Oven to guard insulation strip \r\nmisalignment.    Guard switch bale(s) misadjusted.', 'Adjust the oven out sensor mount \r\nbracket position as needed.  Adjust the guard insulator strip as \r\nneeded.  Adjust the switch bale(s) as needed.', ''),
	(171, 'READY light is not on.  Check Stacker error can be  cleared. ', 2, '7 pin connector between the \r\nLOKPRINT II and 676 partially or \r\ncompletely disconnected. ', 'Reinsert the 7-pin connector.', ''),
	(172, 'System starts but does not pull  fabric though the oven.', 2, 'Finishing Station sensor \r\nmisadjusted.', 'Align sensor and fabric so that the \r\nsensor mark is the first thing the sensor \r\nwill see at restart.   Adjust the sensor sensitivity to respond \r\nto the sense mark on the fabric.', ''),
	(173, 'System stops during batch  READY light is on.  Check Stacker error can be  cleared.', 2, 'Finishing Station cut length \r\nmisadjusted', 'Set the cut length on the Finishing \r\nStation front panel to match the \r\ndistance between the sense marks on \r\nthe fabric after the LOKPRINT II oven.', ''),
	(174, 'Finishing Station displays  Align Stock ', 2, 'LOKPRINT II exit temperature too \r\nhigh. ', 'AVERY DENNISON service to confirm / \r\nset exit temperature as needed.', ''),
	(175, 'Software 259 error', 2, 'The temperature measured by the Fuji monitor falls below the set point', 'Reconfiguring the SP2 Variable Value in the Fuji monitor', ''),
	(176, 'Software 260 error', 2, 'Caused by the Web Tensioner, Arms \r\nDown Sensor or the SS Finisher if one is attached.', 'Check the Out sensor (C Sensor)', ''),
	(177, 'Machine fails to power up  with no light present in   the AC power switch.', 6, '1) Incorrect power voltage.  2) Lack of power to machine.  3) Missing or blown fuse(s)', '1) Confirm that the AC entry is configured for the line voltage intended to be applied to the machine.  Failure to do so can damage the machine\'s internal power supply.  Refer to the "Fuse Configuration".  \r\n2) Check that both ends of the power cord are \r\nplugged in securely. \r\n2A) Confirm that the outlet the machine is plugged \r\ninto has power.\r\n3) Check that the fuse(s) located inside the AC \r\nentry are present and intact.  Replace as needed. \r\nRefer to the "Fuse Configuration".', ''),
	(178, 'Machine fails to power up  with light present in the   AC power switch.', 6, '1) Unconnected cable / connector \r\ninside machine. 2) Thermal Control Board \r\nunplugged from the Mother Board', '1) Power off and remove the power cord from the AC entry.  Remove the back cover and inspect the cables and connectors to and from the power supply.  Refer to the "Electrical System Schematic".\r\n2) Power off and remove the power cord from the AC entry.  Remove the back cover and reseat the Thermal Control Board. ', ''),
	(179, 'Front panel displays no text  or nothing at all.', 6, '1) Front panel cable unplugged. ', '1) Power off and remove the power cord from the \r\nAC entry.  Remove the back cover and inspect \r\nthe cable and connectors to and from the front \r\npanel.  Refer to the "Electrical System \r\nSchematic". ', ''),
	(180, 'Front panel does not  complete diagnostics test 2.', 6, '1) One or more PC board(s) unplugged from the Mother Board. ', '1) Power off and remove the power cord from the AC entry.  Remove the back cover and reseat the offending board. ', ''),
	(181, 'Machine does not receive  batches. ', 6, '1) Serial communications cable loose or unconnected.\r\n2) Machine not powered on or has not completed diagnostics tests.\r\n3) Data sent to wrong printer.\r\n4) Configuration incorrect in PCMate. \r\n5) Faulty Thermal Control Board.\r\n6) Jumpers not configured correctly.', '1) Check and secure both ends of the serial cable with the thumbscrews. \r\n2) Power machine on and wait until machine displays "Ready for batches".  Re-download data.\r\n3) In PCMate change to the printer the data is intended to be sent.\r\n4) Re configure PCMate for AVERY DENNISON PCL printer as per your PCMate manual.\r\n5) Replace Thermal Control Board.\r\n6) Contact AVERY DENNISON Service.', ''),
	(182, 'Stock does not advance  when the start button is   depressed.', 6, '1) No batches to be printed. 2) An interlock condition exists.  3) Feed motor unplugged or faulty.  4) Thermal Control Board \r\nunplugged or faulty.  5) Feed roller not gripping stock. 6) Feed rollers bound.  7) Stock bound.', '1) Download batch (if batch downloaded uses the same format as a previously downloaded batch the machine with start automatically). 2) Determine the number and type of interlock(s) \r\nby reading the front panel display.  As each is corrected the number of errors will decrease (Example "Error 901 Stock Out" reload stock). 3) Check feed motor cable and or replace feed motor.  4) Check Thermal Control Board / AT board connection and or replace Thermal Control Board. 5) Adjust the feed pressure.  Refer to "Mechanical Adjustment Of Feed Roller Pressure".  6) With power off check that all rollers turn freely.  7) With the print head and feed open check that the stock will pull through the printer with little to no resistance.', ''),
	(183, 'Ink does not advance when  the start button is   depressed.', 6, '1) No batches to be printed.  2) An interlock condition exists.  3) Ink motor unplugged or faulty.  4) Thermal Control Board \r\nunplugged or faulty.  5) Ink roller bound.   6) Ink bound. ', '1) Download batch (if batch downloaded uses the same format as a previously downloaded batch the machine with start automatically). 2) Determine the number and type of interlock(s) \r\nby reading the front panel display.  As each is corrected the number of errors will decrease (Example "Error 901 Stock Out" reload stock). 3) Check ink motor cable and or replace ink motor.  4) Check Thermal Control Board / AT board \r\nconnection and or replace Thermal Control Board. 5) With power off check that all rollers and arbors \r\nturn freely.  6) With the print head open check that the ink will \r\npull through the printer with little to no \r\nresistance. ', ''),
	(184, 'Machine advances stock  but does not print.', 6, '1) Print head cable unconnected or faulty.  2) Print head faulty.   3) Head Driver Board unplugged or faulty. ', '1) Power off the machine and reinsert the offending connector or replace cable.  2) Replace print head.  3) Check Head Driver Board / AT board connection and or replace Head Driver Board.', ''),
	(185, 'Print registration is off in  the feed direction.', 6, '1) Print position is incorrect.  2) Field(s) position incorrect in the format.  3) Bound platen roller. ', '1) Enter the setup menu and readjust the print setting as needed.  2) Using formatter - check and readjust the field(s) \r\nposition(s) as needed.   3) Check that the platen roller turns freely on it\'s shaft.  If it does not replace it.', ''),
	(186, 'Print registration is off in  the web direction.', 6, '1) Machine incorrectly threaded.  2) Web guides incorrectly adjusted. 3) Unwind incorrectly adjusted. 4) Incorrect DIP switch settings on \r\nthe Thermal Control Board. ', '1) Check and rethread the media as needed.  Refer \r\nto "Loading Stock".  2) Check and adjust as needed.  Refer to "Web \r\nGuide Adjustment".  3) Check and adjust as needed.  Refer to "Web \r\nGuide Adjustment".   4) Check and reset DIP switches as needed.  Refer \r\nto "TCB Dip Switch S2 Settings".', ''),
	(187, 'Print contrast is too light or  dark. ', 6, '1) Incorrect strobe setting selected \r\nin the format. 2) Incorrect strobe setting in the \r\nmachine setup.', '1) Using Formatter - check and adjust the strobe \r\nsetting according to the media and ink being \r\nused. 2) Enter the setup menu and readjust the strobe as \r\nneeded.', ''),
	(188, 'Voids in print image in the  feed direction. ', 6, '1) Ink misaligned with format.  2) Print head dirty. 3) Faulty print head.  4) Worn platen roller. ', '1) Adjust ink position on the arbors to achieve full \r\nink coverage over all fields on the format.\r\n2) Power off the machine clean the print head and \r\nplaten.  Refer to "Print Head Cleaning".\r\n3) After cleaning head and running the test pattern \r\nto confirm that a void still exists.  Replace the \r\nprint head.\r\n6) Replace platen roller.', ''),
	(189, 'Machine continually stops  with an erroneous   interlock condition.', 6, '1) Ink Sensor uncalibrated. 2) Ink Sensor position misadjusted. 3) Ink sensor type (light / dark) \r\nincorrect in the format for the ink type being used. ', '1) Recalibrate the sensor from the front panel using \r\nthe “Calibrate Sensors” mode.  Refer to "Optical Sensor Electrical Calibration".\r\n2) Relocate correctly.\r\n3) Either change the ink or the ink type in the \r\nformat.', ''),
	(190, 'Stock will not roll or jumps', 6, '1) Incorrect adjustment of unwind \r\nweb guides', '1) Be sure stock roll is as flat as possible and does \r\nnot extend over core.\r\n2) Adjust web guides to touch stock roll but not \r\npinch the roll. ', ''),
	(191, 'Machine fails to stop at end  of roll.', 6, '1) Incorrect adjustment of stock-out \r\nsensor.', '1) Adjust contact strip so that a “click” will be \r\nheard when supply roll is lifted.', ''),
	(192, 'Stock does not pull  smoothly through  printhead module.', 6, '1) Web guides on unwind arm too \r\ntight. 2) Web guides too tight', '1) Adjust web guides to touch outer edges of stock \r\nwith minimum pressure required to keep stock-\r\nout switch closed. \r\n2) Adjust guides to touch edge of stock. ', ''),
	(193, 'Stock jams in bridge blade  rollers or knife area.', 6, '1) Knife mounted bridge blade too \r\nclose to stationary bridge blade. ', '1) Loosen screws in upper knife securing bridge \r\nblade roller assembly and slide up (holes in blade \r\nare slotted) until rollers just contact stock.  Tighten screws. ', ''),
	(194, 'Ink wrinkles or will not pull  smoothly.', 6, '1) Ink buildup on turn bar(s). 2) Incorrect ink width. ', '1) Clean with alcohol.  2) Use an ink width no wider than stock being \r\nprinted.  This is especially critical when using a \r\nnarrow web with cut down rollers. ', ''),
	(195, 'Ink rolls loosely on take-up  roller.', 6, '1) Take-up roller not turning.  2) Take-up core binding on locator plate.  3) Take-up roller too full.', '1) Assure roller does not bind and is clean.  2) Move core .015" - .030" (.38mm - .76mm) away \r\nfrom plate.  3) Remove used ink roll.  It is designed to hold \r\nonly 1 full roll. ', ''),
	(196, 'Poor print - uneven or no  print (mechanical).  Also  see electrical trouble   shooting.', 6, '1) Broken ink.  2) Ink not rewinding.', '1) Replace ink and readjust (see INK trouble shooting).  2) Readjust (see INK trouble shooting).', ''),
	(197, 'No imprime.', 1, 'Material, Cinta, Alimentacion, Conexion', 'Revise el material.\r\nRevise la cinta.\r\nPresione ALIMENTACIÓN.\r\nCompruebe la conexión con el host.', ''),
	(198, 'No se introduce material.', 1, 'Material, Cinta, Atasco, Cabezal', 'Revise el material.\r\nRevise la cinta.\r\nDespeje el atasco.\r\nCierre el cabezal por completo.', ''),
	(199, 'Datos impresos parcialmente.', 1, 'Cabezal', 'Limpie el cabezal.\r\nReenvíe el lote (trabajo de impresión).', ''),
	(200, 'Impresión clara/oscura o con puntos vacíos.', 1, 'Cabezal,Material, Contraste', 'Limpie el cabezal.\r\nCambie el material.\r\nAjuste el contraste. Consulte “Ajuste del contraste de\r\nimpresión”.\r\nAjuste los diales de presión del cabezal. Consulte “Ajuste\r\nde los diales de presión del cabezal.”\r\nRevise la cinta.', ''),
	(201, 'Los códigos de barras serie se imprimen con espacios vacíos o no se pueden leer.', 1, 'Contraste', 'Ajuste el contraste. Consulte “Ajuste del contraste de\r\nimpresión”.\r\nEl administrador del sistema puede cambiar la velocidad de\r\nimpresión a 2,5 IPS.', ''),
	(202, 'Lámina enrollada alrededor del rodillo de la pletina.', 1, 'Atasco, Rodillo de la pletina', 'Despeje el atasco.\r\nLimpie el rodillo de la pletina.\r\nDeje el cabezal sin bloquear cuando no vaya a utilizar la\r\nimpresora durante un largo periodo de tiempo.', ''),
	(203, 'Etiquetas impresas en blanco.', 1, 'Formato', 'El administrador del sistema debe comprobar el formato.\r\nPuede que la impresora no esté diseñada para el tamaño de\r\nmaterial cargado.', ''),
	(204, '411', 1, 'Conexion del Host', 'Asegúrese de que los valores de comunicación de la impresora coinciden\r\ncon los del host.', ''),
	(205, '614', 1, 'Caracter no valida en la data', 'Compruebe si hay caracteres no válidos en los paquetes de datos. Consulte\r\nal administrador del sistema.', ''),
	(206, '616', 1, 'Cabezal', 'No se imprimió un código de barras en la etiqueta. Consulte al\r\nadministrador del sistema. Revise o sustituya el cabezal.', ''),
	(207, '703 Or 704', 1, 'Material', 'Revise o cargue el material. El tipo de material de la impresora debe\r\ncoincidir con el material cargado. Por ejemplo, la impresora está\r\nconfigurada para material troquelado, pero se ha cargado material con\r\nmarca negra.', ''),
	(208, '741 OR 743', 1, 'Carga del Material', 'Revise la carga del material y los ajustes de Monarch® RFID Printer Setup\r\nUtility.', ''),
	(209, '750', 1, 'Cabezal demasiado caliente', 'Apague la impresora y deje que el cabezal se enfríe.', ''),
	(210, '751 OR 752 OR 753', 1, 'Carga del Material, Sensor', 'Revise o cargue el material.\r\nPresione ENTER (ENTRAR) para continuar la impresión.\r\nLimpie el sensor.', ''),
	(211, '754', 1, 'Carga de la Cinta', 'Revise o cargue la cinta. Presione ENTER (ENTRAR) para continuar la\r\nimpresión.', ''),
	(212, '755', 1, 'Cabezal Abierta', 'Cierre el cabezal para continuar.', ''),
	(213, '756', 1, 'Material', 'Cargue el material. Presione ENTER (ENTRAR) para continuar la\r\nimpresión.', ''),
	(214, '758', 1, 'Atasco de etiqueta', 'Compruebe si hay un atasco de etiquetas, despeje el atasco, o vuelva a\r\ncargar el material. Este error puede ocurrir si retira una etiqueta demasiado\r\nrápido en el modo bajo demanda.', ''),
	(215, '763', 1, '', 'Esperando a dispensar una etiqueta. Presione FEED (ALIMENTACIÓN).', ''),
	(216, '765 OR 768', 1, '', 'Revise o sustituya el cabezal. Presione ENTER (ENTRAR) para continuar.', ''),
	(217, '785 OR 786', 1, '', 'Retire la lámina del rollo de captación. Vuelva a cargar el material para\r\ncaptación de la lámina. Presione ENTER (ENTRAR) para continuar.', '');
